import React from 'react';
import { Home, Navbar, About, Portfolio, Skills, Contact } from './components';

function App() {
  return (
    <div>
      <html data-theme="winter"></html>
      <Navbar />
      <Home />
      <About />
      <Skills />
      <Portfolio />
      <Contact /> 
    </div>
  );
}

export default App;
